Leobank – Azərbaycanın ilk mobil bankdır. Biz bütün bank proseduralarını sadələşdirdik və rahat tətbiq yaratdıq, həmçinin sərfəli kredit kartı təqdim etdik.
Kart sifarişi – ödənişsiz. Azərbaycan daxilində istənilən bank kartlarına köçürmələr komissiyasız. 10 000 manata qədər kredit limiti və 62 günədək faizsiz güzəşt müddəti. 20% qədər cashback. Azərbaycan ərazisində istənilən alış-veriş üçün 3 ödənişdən ibarət pulsuz taksit.

Kartı əldə etmək çox asandır:
Kartı birbaşa tətbiqdə sifariş edin və biz onu pulsuz çatdıraq.

Kredit üzrə sərfəli şərtlər:
- 10 000 ₼-dək kredit limiti;
- kredit vəsaitlərini 62 günədək pulsuz istifadə edin;
- Azərbaycanın istənilən mağazasında 3 ödənişli pulsuz taksit;
- yaxınlarınıza zəng etmədən, kredit limiti.

İstənilən alış-veriş üçün pulsuz taksit:
- Azərbaycanın istənilən mağazasında onlayn və ya oflayn alış-verişi hissələrlə, komissiyasız və faizsız ödəmə imkanı;
- taksit 50 manat məbləğində olan yeni və həmçinin artıq etdiyiniz alış-veriş üçün mümkündür;
- 3 bərabər ödəniş.

Kart hesabının tətbiqdə idarə olunması:
- PİN-kodun dəyişdirilməsi;
- kartın bloklanması/blokdan çıxarılması;
- internet limitinin idarə edilməsi;
- istənilən dövr üçün pulsuz kart çıxarışı.

Mükəmməl tətbiq və kart:
- gözəl və rahat mobil tətbiq;
- 20%-dək cashback;
- kartdakı şəxsi vəsaitlər üzərinə 5% əlavə gəlir hesablayırıq;
- xərclərinizn rahat analitikası, gözəl qrafiklər, xərclər üçün teq və qeydlər;
- dəstək xidmətində heç bir robot yoxdur, istənilən rahat messencerdə və ya telefonla birbaşa əlaqə.
